import React from 'react';
import './App.css';

import Board from './Board'


class App {
  constructor(props) {
    this.state = {
      dim: 2
    };
  }
  render() {
    return (
      <div className="App">
        <div>
        </div>
        <Board dim={this.state.dim}/>
      </div>
    );  
  }

}

export default App;
